import React from 'react';
import Typography from '@mui/material/Typography';
import Link from '@mui/material/Link';
import Box from '@mui/material/Box';

const Portfolio = () => {
  return (
    <Box sx={{ padding: 3 }}>
      <Typography variant="h4" gutterBottom>Portfolio</Typography>

      {/* Lighting Category */}
      <Typography variant="h5" gutterBottom>Lighting</Typography>
      <Link href="https://www.youtube.com/watch?v=moAfqFo3f00" target="_blank" rel="noopener">
        Thinking hurts - Ji the prince
      </Link>

      {/* Assistant Camera and Drone Category */}
      <Typography variant="h5" gutterBottom>Assistant Camera and Drone</Typography>
      <Link href="https://www.youtube.com/watch?v=ULjGbYWbJDU" target="_blank" rel="noopener">
        Debs House
      </Link>

      {/* Camera Category */}
      <Typography variant="h5" gutterBottom>Camera</Typography>
      <Link href="https://www.instagram.com/reel/CzMeq4rPI6Z/?igshid=MWg5ajJqOGtmMzZ5MA==" target="_blank" rel="noopener">
        Heidi Klum Halloween
      </Link>

      {/* Drone Category */}
      <Typography variant="h5" gutterBottom>Drone</Typography>
      <Link href="https://www.youtube.com/watch?v=HeZck91SBIY" target="_blank" rel="noopener">
        ShaqnLIvin - Having my Way ft. Capella Grey
      </Link>
      <Link href="https://vimeo.com/921814656/686ea8af77" target="_blank" rel="noopener" sx={{ display: 'block' }}>
        Free arts program - Time mark 1:11
      </Link>

      {/* General Production Category */}
      <Typography variant="h5" gutterBottom>General Production</Typography>
      <Link href="https://www.youtube.com/shorts/sc8DXDWRKac" target="_blank" rel="noopener">
        Khaby is coming to America
      </Link>
      <Link href="https://www.youtube.com/watch?v=hklSInDi5Rc" target="_blank" rel="noopener">
        All Up in the Biz
      </Link>

    </Box>
  );
};

export default Portfolio;
